function makeLink(){const h=Joomla.getOptions("variables",{}),b=document.getElementById("filter_campusID"),g=document.getElementById("filter_categoryID"),d=document.getElementById("filter_groupID"),a=document.getElementById("filter_methodID"),f=document.getElementById("filter_organizationID"),e=document.getElementById("filter_personID"),c=document.getElementById("filter_roomID");let url=h.ICS_URL,campusID,methodID,my,organizationID,roomID;if(typeof h.my!=="undefined"&&typeof h.auth!=="undefined"&&typeof h.username!=="undefined"){url+="&auth="+h.auth+"&my=1&username="+h.username}else{if(typeof h.campusID!=="undefined"){campusID=h.campusID}else{if(b!==null&&b.value){campusID=b.value}}if(typeof campusID!=="undefined"){url+="&campusID="+campusID}if(g!==null&&g.value){url+="&categoryID="+g.value}if(typeof h.dow!=="undefined"){url+="&dow="+h.dow}if(d!==null&&d.value){url+="&groupID="+d.value}if(typeof h.methodID!=="undefined"){methodID=h.methodID}else{if(a!==null&&a.value){methodID=a.value}}if(typeof methodID!=="undefined"){url+="&methodID="+methodID}if(typeof h.organizationID!=="undefined"){organizationID=h.organizationID}else{if(f!==null&&f.value){organizationID=f.value}}if(typeof organizationID!=="undefined"){url+="&organizationID="+organizationID}if(e!==null&&e.value){url+="&personID="+e.value}if(c!==null&&c.value){url+="&roomID="+c.value}}window.prompt(Joomla.JText._("ORGANIZER_GENERATE_LINK"),url);return};